{{Information
|Description=An overview of B1 cell functions. The B1 cell fulfills crucial homeostatic functions. However, it can act as a “double-edged sword,” playing a protective or harmful role. Here, we present an up-to-date overview of B1 cell function in health and possibly in multiple sclerosis (MS). The functions described here are based on experiments in mice or humans, referenced and discussed in detail in the text. Note: mouse B1a cells were recently shown to be present in the central nervous system (CNS), to facilitate differentiation of oligodendrocytes, and to support remyelination of injured axons (bottom left and middle panels). Whether this observation also holds to human B1 cells warrants investigation. 
|Date=2022-03-04
|Source=https://www.mdpi.com/2227-9059/10/3/606   Halperin, S.T.; ’t Hart, B.A.; Luchicchi, A.; Schenk, G.J. The Forgotten Brother: The Innate-like B1 Cell in Multiple Sclerosis. Biomedicines 2022, 10, 606. https://doi.org/10.3390/biomedicines10030606
|Author=Halperin, S.T.; ’t Hart, B.A.; Luchicchi, A.; Schenk, G.J.
|Permission=
|other_versions=
}}

